import React from "react";
import logo from "./logo.png";
import { NavLink } from "react-router-dom";
function Header() {
  return (
    <div style={{ paddingLeft: "150px", paddingRight: "20px" }}>
      <nav style={{ backgroundColor: "#FFCCCC", height: "85px" }}>
        <img src={logo} style={{ width: "100px", height: "80px" }} />
        <NavLink style={{ marginLeft: "800px" }} to="/">
          Home
        </NavLink>
        <NavLink style={{ marginLeft: "80px" }} to="/novels">
          Novels
        </NavLink>
        <NavLink style={{ marginLeft: "80px" }} to="/about">
          About
        </NavLink>
      </nav>
    </div>
  );
}
export default Header;
